export default function Square({ value, idx, onPlay, playersTurn }) {
  var styleCSS = value
    ? `player-${value > 0 ? "X" : "O"}`
    : `hover-${playersTurn}`;
  return (
    <button className={"square " + styleCSS} onClick={() => onPlay(idx)}>
      {value ? (value > 0 ? "X" : "O") : playersTurn}
    </button>
  );
}
